/***************************************************************************************
 * 数据获取和预处理
 ***************************************************************************************/

// 时间参数
var year = 2022;
var start = year + '-09-01';
var end = year + '-12-31';
var dataRange = ee.DateRange(start, end);

// Sentinel-2数据获取
var s2 = "COPERNICUS/S2_SR_HARMONIZED";
var s2ImageCol = getS2ImageCol(roi, s2, dataRange);
var s2Image = s2ImageCol.median().clip(roi);

// AlphaEarth数据获取 - 使用重要的5个波段
var alphaEarthCollection = ee.ImageCollection('GOOGLE/SATELLITE_EMBEDDING/V1/ANNUAL');
var alphaEarthImage = alphaEarthCollection
  .filterDate(year + '-01-01', (year + 1) + '-01-01')
  .filterBounds(roi)
  .mean()
  .select(['A31', 'A63', 'A36', 'A47', 'A46'])  // 前5重要波段
  .clip(roi);

// 合并Sentinel-2和AlphaEarth数据
var combinedImage = s2Image.addBands(alphaEarthImage);

// 显示输入数据
Map.addLayer(s2Image, {
  'min': 0.0, 
  'max': 0.3, 
  'bands': ['B4', 'B3', 'B2']
}, 'Sentinel-2 RGB');

Map.addLayer(alphaEarthImage, {
  'min': -0.3, 
  'max': 0.3, 
  'bands': ['A31', 'A63', 'A36']
}, 'AlphaEarth Features');

/***************************************************************************************
 * CNN模型部署
 ***************************************************************************************/

// 第一层卷积: 15 -> 16, 3x3卷积
var conv1_result = applyConvolution3x3(combinedImage, conv1_weight, conv1_bias, true);
conv1_result = conv1_result.clip(roi);

// 第二层卷积: 16 -> 32, 3x3卷积  
var conv2_result = applyConvolution3x3(conv1_result, conv2_weight, conv2_bias, true);
conv2_result = conv2_result.clip(roi);

// 提取中心1x1特征并与conv2结果连接
var center_1x1 = extractCenter1x1(combinedImage);
var conv3_input = conv2_result.addBands(center_1x1);

// 第三层卷积: 47 -> 64, 1x1卷积
var conv3_result = applyConvolution1x1(conv3_input, conv3_weight, conv3_bias, true);
conv3_result = conv3_result.clip(roi);

// 第四层卷积: 64 -> 128, 1x1卷积
var conv4_result = applyConvolution1x1(conv3_result, conv4_weight, conv4_bias, true);
conv4_result = conv4_result.clip(roi);

// 第五层卷积: 128 -> 2, 1x1卷积 (输出层)
var conv5_result = applyConvolution1x1(conv4_result, conv5_weight, conv5_bias, false);
conv5_result = conv5_result.clip(roi);

// 应用softmax并生成最终分类结果
var waterMask = conv5_result.expression(
  "b1 > b0 ? 1 : 0",  // 如果水体概率 > 非水体概率，则为水体
  {
    b0: conv5_result.select(0), // 非水体概率
    b1: conv5_result.select(1)  // 水体概率
  }
);

// 应用质量掩膜
var qualityMask = s2Image.select('B2').gt(0.01);  // 基本质量掩膜
waterMask = waterMask.updateMask(qualityMask);

// 显示结果
Map.addLayer(waterMask.selfMask(), {
  'palette': ['blue']
}, 'CNN Water Detection');

/***************************************************************************************
 * 辅助函数定义
 ***************************************************************************************/

// 3x3卷积函数
function applyConvolution3x3(image, conv_weights, conv_biases, useReLU) {
  var convolvedImages = ee.List.sequence(0, conv_weights.length().subtract(1)).map(function(index) {
    var kernelWeights = ee.List(conv_weights.get(index));
    var bias = ee.Number(conv_biases.get(index));
    
    var convolvedBands = image.bandNames().map(function(bandName) {
      var bandIndex = image.bandNames().indexOf(bandName);
      var kernelData = ee.List(kernelWeights.get(bandIndex));
      var kernel = ee.Kernel.fixed(3, 3, kernelData);
      var convolvedBand = image.select([bandName]).convolve(kernel);
      return convolvedBand;
    });
    
    var sumResult = ee.ImageCollection.fromImages(convolvedBands)
      .reduce(ee.Reducer.sum())
      .add(bias);
    
    return sumResult;
  });
  
  var combinedImage = ee.ImageCollection(convolvedImages).toBands();
  
  if (useReLU) {
    return combinedImage.max(0);  // ReLU激活
  } else {
    return combinedImage;
  }
}

// 1x1卷积函数
function applyConvolution1x1(image, conv_weights, conv_biases, useReLU) {
  var convolvedImages = ee.List.sequence(0, conv_weights.length().subtract(1)).map(function(index) {
    var kernelWeights = ee.List(conv_weights.get(index));
    var bias = ee.Number(conv_biases.get(index));
    
    var weightedSum = image.bandNames().map(function(bandName) {
      var bandIndex = image.bandNames().indexOf(bandName);
      var weight = ee.Number(kernelWeights.get(bandIndex));
      return image.select([bandName]).multiply(weight);
    });
    
    var sumResult = ee.ImageCollection.fromImages(weightedSum)
      .reduce(ee.Reducer.sum())
      .add(bias);
    
    return sumResult;
  });
  
  var combinedImage = ee.ImageCollection(convolvedImages).toBands();
  
  if (useReLU) {
    return combinedImage.max(0);  // ReLU激活
  } else {
    return combinedImage;
  }
}

// 提取中心1x1特征函数
function extractCenter1x1(image) {
  // 对于5x5窗口，中心像素位置是(2,2)
  // 这里我们直接返回原图像，因为在实际应用中中心特征就是当前像素值
  return image;
}

// Sentinel-2数据预处理函数
function getS2ImageCol(roi, s2, dataRange) {
  var s2Col = ee.ImageCollection(s2)
    .filterBounds(roi)
    .filterDate(dataRange)
    .map(rmCloudByQA)
    .select(["B2", "B3", "B4", "B5", "B6", "B7", "B8", "B8A", "B11", "B12"])
    .map(reScale);
  return s2Col;
}

// 云掩膜函数
function rmCloudByQA(image) {
  var qa = image.select('QA60');
  var cloudBitMask = 1 << 10;
  var cirrusBitMask = 1 << 11;
  var mask = qa.bitwiseAnd(cloudBitMask).eq(0)
    .and(qa.bitwiseAnd(cirrusBitMask).eq(0));
  return image.updateMask(mask);
}

// 重新缩放函数
function reScale(image) {
  return image.divide(10000);
}

